import React , {useEffect} from 'react'
import {Table  ,Row ,Container , Col ,Button ,ButtonGroup ,Form, Navbar} from "react-bootstrap"
import {useDispatch, useSelector} from 'react-redux';
import { loadWorkers } from '../redux/actions';
import 'bootstrap/dist/css/bootstrap.min.css';


const Workers= ()=>{
    const dispatch = useDispatch();
    const {Workers} = useSelector(state => state.data);
 useEffect(() => {
 dispatch(loadWorkers());
 },[]);

 return (
    <>
    <Container>
        <Row>
            <Col md ={4}>Form</Col>
            <Col md ={8}>
             <Table boarded hover>
                 <thead>
                     <tr>
                     <th>No.</th>
                     <th>Name</th>
                     <th>Email</th>
                     <th>PhoneNumber</th>
                     <th>Age</th>
                     </tr>
                 </thead>
                 {Workers && Worker.map((item,index)=>(
                     <tbody key ={index}>
                         <tr>
                             <td>{index+1}</td>
                             <td>{item.name}</td>
                             <td>{item.email}</td>
                             <td>{item.phoneNumber}</td>
                             <td>{item.age}</td>
                             <td>
                                 <ButtonGroup>
                                     <Button style ={{marginRight:"5px"}} variant="danger">
                                         Delete
                                     </Button>
                                     <Button  variant="secondary">
                                         Update
                                     </Button>
                                 </ButtonGroup>
                             </td>

                         </tr>

                     </tbody>
                 ))}

             </Table>
            </Col>
        </Row>
    </Container>
    </>
 );
};

export default Workers
